import React from 'react';

const VerClientesPage = () => {
  return (
    <div className="container mt-5">
      <h1>Ver Clientes</h1>
      <p>Aquí podrás ver un listado de todos los clientes. En un futuro iremos añadiendo estadisticas, etc.</p>
    </div>
  );
};

export default EntidadesPage;
